body:
This PR is a work-in-progress for #178.

The log handler API that takes care of streamlit logging will be exposed as an end-user accessible API. Example usage:

```py
cfg = {
    "checks": [
        {
            "type": uptrain.Visual.PLOT,
            "plot": uptrain.PlotType.LINE_CHART,
            "x_feature_name": "epochs",
            "y_feature_name": "loss"
        },
        {
            "type": uptrain.Visual.PLOT,
            "plot": uptrain.PlotType.HISTOGRAM,
            "feature_name": "customer_wait_time", 
            "dashboard_name": "Customer Wait Time for Different Stores"
        }
    ]
}
```
